  return (
    <div className="d-flex justify-content-center">
      <h1>你好我是</h1>
      <h1>
        <Typewriter
          options={{
            strings: [locale.FrontEndEngineer, locale.DivingLover],
            autoStart: true,
            loop: true,
          }}
        />
      </h1>
    </div>
  );
}
export default MainPage;
